import React from "react";
import "./Home.css";
import Poster from "./Poster";
import poster_one from "./img/poster__home__page/poster_one.jpg";
import poster_two from "./img/poster__home__page/poster_two.jpg";
import poster_three from "./img/poster__home__page/poster_three.jpg";
import poster_four from "./img/poster__home__page/poster_four.jpg";
import Product from "./Product";

function Home() {
  const banners = [poster_one, poster_two, poster_three, poster_four];
  return (
    <div className="home">
      <div className="container">
          div.banner
        <Poster bannersArray={banners} />

        <div className="home__row">
          <Product
            id="4427"
            title="Comfy styles for her"
            price={99}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2019/July/amazonbasics_520x520._SY304_CB442725065_.jpg"
            rating={5}
          />

          <Product
            id="565"
            title="Comfy styles for her"
            price={99}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2019/July/amazonbasics_520x520._SY304_CB442725065_.jpg"
            rating={5}
          />
        </div>
        <div className="home__row">
          <Product
            id="7855"
            title="Comfy styles for her"
            price={99}
            image="https://images-na.ssl-images-amazon.com/images/G/01/AmazonExports/Fuji/2019/July/amazonbasics_520x520._SY304_CB442725065_.jpg"
            rating={5}
          />
        </div>
      </div>
    </div>
  );
}

export default Home;
